.kai {
  background: white;
  border-radius: 10px;
  border: 1px solid #3765f8;
  color: #3765f8;
  margin-top: 10px;
  font-size: 14px;
  width: 105px;
  height: 28px;
  outline: none;
}
.lan {
  width: 100%;
  height: calc(100vh - 80px);
  background: #eff3ff;
  overflow: hidden;
}
.page-bar {
  position: absolute;
  bottom: 20px;
  right: 10px;
  user-select: none;
}
.page-bar li {
  float: left;
  list-style: none;
}
.page-bar li:first-child > a {
  margin-left: 0px;
}
.page-bar a {
  border: 0;
  text-decoration: none;
  position: relative;
  text-align: center;
  margin-left: -1px;
  cursor: pointer;
  display: inline-block;
  width: 1.6vw;
  height: 1.6vw;
  line-height: 1.6vw;
  border-radius: 3px;
  background: white;
  margin: 0.5vw;
  color: black;
  font-size: 0.7vw;
  border: 1px solid gainsboro;
}
.tishi {
  width: 98%;
  height: 20.5%;
  background: white;
  box-shadow: 0px 0px 13px 0px rgba(63, 106, 255, 0.08);
  border-radius: 3px;
  margin-left:1%;
  margin-top:1.1%;
}
